const Card = ({ apiKey }) => {

    const [users, setUser] = useState([]);

    const getUser = async () => {
        const response = await fetch('https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json')
        setUser(await response.json());
    }
    users.map((users) => {
        return (
            <div class="card-group">
                <div class="card">
                    {users.desc}
                </div>
            </div>
        )

    })

    useEffect(() => {
        getUser();
    }, [apiKey]);

